}

.divimgocult {
    max-width: 90%;
    background-repeat: no-repeat;
    background-size: cover;
    background-position: center;
    position: relative;
    display: flex;
    margin: 40px auto;
    border-radius: 10px;
    top: 0px;
    justify-content: center;
    align-items: center;
}

.imgbotao {
    float: left;
    display: inline;
    position: absolute;
    z-index: 4;
    margin: -10px auto;
    height: 20px;
    width: 80px;
    top: calc(50% - 10px);
