    border: 0.5px solid var(--cor7);
    border-radius: 5px;
    text-align: center;
    background-color: var(--cor8);
    padding: 5px 5px 5px;
    color: var(--cor7);
    cursor: pointer;
    font-size: 16px;
    transition-property: border box-shadow;
    transition-duration: 0.5s;
    transition-delay: 0s;
}

.imgocult {
    max-height: 100%;
    max-width: 100%;
    position: absolute;
    top: 0px;
    border-radius: 10px;
    background-size: cover;
    background-repeat: no-repeat;
    background-position: center;
    margin: auto;
